import './App.css';
import Home from './Components/Home';
import Navbar from './Layout/Navbar'
import Trading from './Components/Trading';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />

        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/trade">
            <Trading />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
